import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'User-controller';

  
}
<mat-toolbar color="primary">
    <mat-toolbar-row>
      <a class="logo" routerLink="/">User-manager app</a>
      <span class="example-spacer"></span>
      <a mat-raised-button color="warn" class="nav-btn" routerLink="/">See users</a>
      <a mat-raised-button color="warn" class="nav-btn" routerLink="/addUser">Add user</a>
      <a mat-raised-button color="warn" routerLink="/login">Login</a>
    </mat-toolbar-row>
</mat-toolbar>
<router-outlet></router-outlet>
